package dupblock

import "testing"

func TestSet1(t *testing.T) {
	data := []byte(`{}`)
	db := []byte(`set .
{"A":"1","B":"2"}
*`)
	nd, e := ApplyDUPBlock(data, db)
	if e != nil {
		t.Error("Unexpected error.", e)
	} else if string(nd) != `{"A":"1","B":"2"}` {
		t.Error("Incorrect return data.", nd)
	}
}

func TestSet2(t *testing.T) {
	data := []byte(`[{"A":"1"},{"B":"2"}]`)
	db := []byte(`set [0]
{"C":"3"}
*`)
	nd, e := ApplyDUPBlock(data, db)
	if e != nil {
		t.Error("Unexpected error.", e)
	} else if string(nd) != `[{"C":"3"},{"B":"2"}]` {
		t.Error("Incorrect return data.", nd)
	}
}

